# This is a loader script for the RL78-15 SREC files. 
# The memory regions and registers virtual addresses are taken from the datasheet 
# based on the R5F113TG model. 
# All the data is already inside the script, no outside resources are required.

def createUninitializedMemoryBlock(name, addr, size):

    # if already created
    if getMemoryBlock(toAddr(addr)):
        return

    return getCurrentProgram().memory.createUninitializedBlock(name, toAddr(addr), size, False)

